import React from 'react'
import Button from './Button'
const Head = ({title}) => {
    const onclick=()=>{
        console.log('clicked');
    }
    return (
    <div className='header'>
        <h1>{title}</h1>
        <Button onclick={onclick} color='green' text='Add'/>
    </div>
  )
}
Head.defaultProps={
    title:"hello world"
}
export default Head
